import StockList from './StockList';
import {getStocks} from './services';


function StockApp({onLogout, user}){

   const [stocks, setStocks] = useState([]);	

   const refreshStocks = useCallback(() => {
      getStocks()
      .then( stockList => { 
      setMessages(stockList);
      })
      .catch(function(e){
         setErrorMessage(e.message);
      });
},[]);

   useEffect(() => {
      refreshStocks();
   },[]);


	return (
   <div>
      <StockList stocks={stocks}/>
   </div>
	);
};

